import MusicBox from "./components/MusicBox/MusicBox";
import Login from "./components/Login";
import { Route, Switch, BrowserRouter } from "react-router-doom";

function App() {
   return (
      <BrowserRouter>
         <Switch>
            <Route component={Login} path="/login" />
            <Route component={Login} path="/" />
         </Switch>
      </BrowserRouter>
   );
}

export default App;
